// src/pages/Home.jsx
import React, { useEffect, useState } from 'react';
import cgvImage from '../assets/img/cgv.jpg';
import cineqImage from '../assets/img/cineq.jpg';
import megaboxImage from '../assets/img/megabox.jpg';
import mvcImage from '../assets/img/mvc.jpg';
import seriesonImage from '../assets/img/serieson.jpg';
import bannerImage from '../assets/img/banner.jpg';

const urlPatterns = {
    CGV: (company, date) => `${company}/${company}Chart_${date}.json`,
    CineQ: (company, date) => `${company}/${company}Chart_${date}.json`,
    Moviechart: (company, date) => `${company}/${company}Chart_${date}.json`,
    Serieson: (company, date) => `${company}/serieson_chart${date}.json`,
    Megabox: (company, date) => `${company}/${company}Chart_${date}.json`
};

function generateUrl(company, date) {
    const formattedDate = date.toISOString().slice(0, 10);
    const pattern = urlPatterns[company];
    const url = `https://raw.githubusercontent.com/kimyih/movie-chart2/main/${pattern(company, formattedDate)}`;
    return url;
}

function HomePage() {
    const [megaboxData, setMegaboxData] = useState([]);
    const [cineqData, setCineqData] = useState([]);
    const [cgvData, setCgvData] = useState([]);
    const [mvcData, setMvcData] = useState([]);
    const [seriesonData, setSeriesonData] = useState([]);
    const today = new Date();

    useEffect(() => {
        const fetchData = async (company, setData) => {
            const url = generateUrl(company, today);
            try {
                const response = await fetch(url);
                if (!response.ok) {
                    throw new Error(`HTTP error! status: ${response.status}`);
                }
                const data = await response.json();
                setData(data.slice(0, 10));
            } catch (error) {
                console.error("There was an error fetching the data:", error);
            }
        };

        fetchData('Megabox', setMegaboxData);
        fetchData('CineQ', setCineqData);
        fetchData('CGV', setCgvData);
        fetchData('Moviechart', setMvcData);
        fetchData('Serieson', setSeriesonData);
    }, [today]);

    return (
        <div className="Main__Movie">
            <h1>Movie Rank</h1>
            <div className='banner'>
                <img src={bannerImage} alt="banner" />
                <img src={bannerImage} alt="banner" />
                <img src={bannerImage} alt="banner" />
            </div>
            <div className='Cinema'>
                <a href="#megabox"><img src={megaboxImage} alt="megabox" /></a>
                <a href="#cineq"><img src={cineqImage} alt="cineq" /></a>
                <a href="#cgv"><img src={cgvImage} alt="cgv" /></a>
                <a href="#moviechart"><img src={mvcImage} alt="mvc" /></a>
                <a href="#serieson"><img src={seriesonImage} alt="serieson" /></a>
            </div>
            <div id="megabox">
                <h2>Megabox</h2>
                <ul className='Main__info' style={{ display: 'flex', flexWrap: 'wrap' }}>
                    {megaboxData.map((item, index) => (
                        <li key={index} style={{ flex: '0 1 10%', listStyle: 'none', padding: '10px' }}>
                            <img src={item.imageURL} alt={item.title} style={{ width: "100%", height: "auto" }} />
                            <div>{item.rank}</div>
                            <div>{item.date}</div>
                            <div>{item.title}</div>
                        </li>
                    ))}
                </ul>
            </div>
            <div id="cineq">
                <h2>CineQ</h2>
                <ul className='Main__info' style={{ display: 'flex', flexWrap: 'wrap' }}>
                    {cineqData.map((item, index) => (
                        <li key={index} style={{ flex: '0 1 10%', listStyle: 'none', padding: '10px' }}>
                            <img src={item.imageURL} alt={item.title} style={{ width: "100%", height: "auto" }} />
                            <div>{item.rank}</div>
                            <div>{item.date}</div>
                            <div>{item.title}</div>
                        </li>
                    ))}
                </ul>
            </div>
            <div id="cgv">
                <h2>CGV</h2>
                <ul className='Main__info' style={{ display: 'flex', flexWrap: 'wrap' }}>
                    {cgvData.map((item, index) => (
                        <li key={index} style={{ flex: '0 1 10%', listStyle: 'none', padding: '10px' }}>
                            <img src={item.imageURL} alt={item.title} style={{ width: "100%", height: "auto" }} />
                            <div>{item.rank}</div>
                            <div>{item.date}</div>
                            <div>{item.title}</div>
                        </li>
                    ))}
                </ul>
            </div>
            <div id="moviechart">
                <h2>Moviechart</h2>
                <ul className='Main__info' style={{ display: 'flex', flexWrap: 'wrap' }}>
                    {mvcData.map((item, index) => (
                        <li key={index} style={{ flex: '0 1 10%', listStyle: 'none', padding: '10px' }}>
                            <img src={item.imageURL} alt={item.title} style={{ width: "100%", height: "auto" }} />
                            <div>{item.rank}</div>
                            <div>{item.date}</div>
                            <div>{item.title}</div>
                        </li>
                    ))}
                </ul>
            </div>
            <div id="serieson">
                <h2>Serieson</h2>
                <ul className='Main__info' style={{ display: 'flex', flexWrap: 'wrap' }}>
                    {seriesonData.map((item, index) => (
                        <li key={index} style={{ flex: '0 1 10%', listStyle: 'none', padding: '10px' }}>
                            <img src={item.imageURL} alt={item.title} style={{ width: "100%", height: "auto" }} />
                            <div>{item.rank}</div>
                            <div>{item.date}</div>
                            <div>{item.title}</div>
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default HomePage;
